import Disclaimer from './Components/Contactus/Disclaimer'
import Developer from './Components/Contactus/Developer'
import Faq from './Components/Contactus/Faq';

export default function Contactus() {
    return (
        <>
            <div className="contactus">
                <a href={Disclaimer}>Disclaimer<div className="disclaimer"><Disclaimer /></div></a>
                <a href={Developer}>Developer?<div className="developer"><Developer /></div></a>
                <a href={Faq}>Customer Service<div className="faq"><Faq /></div></a>
            </div>
        </>
    );
}
